eg:module.parseFn:
(str) => {
                if (/^M\d{3,7}$/.test(str)) {
                    return { moduleId: str.substring(1) };
                }
                return null;
            };

eg:module.lookupFn:
(str, raw) => {
                if (raw.moduleId != null){
                    if (/^M\d+$/.test(str) ) {
                        if (str.substring(1) === raw.moduleId) {
                            return 100;
                        }
                        if (raw.moduleId.startsWith(str.substring(1))) {
                            return 10;
                        }
                    }
                    if (raw.moduleId.indexOf(str.substring(1)) > -1) {
                        return 1;
                    }
                }
                return 0;
            };

