user.parseFn:
(str) => {
  if (/^@[a-z]{3}\d{5}$/.test(str)) {
    return { username: str.substring(1) };
  }
  return null;
};

user.lookupFn:
(str, raw) => {
  if (raw.username != null && /^@[a-z]{1,3}/.test(str))
    return raw.username.indexOf(str.substring(1)) === 0 ? 10 : 0;
  if (raw.username != null && raw.username.indexOf(str) > -1)
    return 1;
  return 0;
};
